script: |
  super -f text -I q5700.spq | sort > q5700.out

inputs:
  - name: q5700.spq
    data: |
      SELECT - col1 AS col1, col1 - - col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( col0 + - 25 * + col0, - 27, col1 - - col1 );
  - name: tab1

outputs:
  - name: q5700.out
    data: |
